uint16_t getColorFromName(const char *colorName)
{
  if (strcmp(colorName, "red") == 0)
    return ST7735_RED;
  if (strcmp(colorName, "blue") == 0)
    return ST7735_BLUE;
  if (strcmp(colorName, "green") == 0)
    return ST7735_GREEN;
  if (strcmp(colorName, "white") == 0)
    return ST7735_WHITE;
  if (strcmp(colorName, "black") == 0)
    return ST7735_BLACK;
  if (strcmp(colorName, "yellow") == 0)
    return ST7735_YELLOW;
  if (strcmp(colorName, "cyan") == 0)
    return ST7735_CYAN;
  if (strcmp(colorName, "magenta") == 0)
    return ST7735_MAGENTA;
  return ST7735_WHITE;
}

